            main: secondary,
            dark: secondaryDark,
            contrastText: contrastSecondaryText
        },
        error: { main: error },
        alert: { main: alert },
        success: {
            main: success,
            hover: successHover
        },
        text: {
            primary: primaryText,
            secondary: secondaryText,
            disabled
        },
        grey: {
            50: border,
            1000: offwhite
        },
        tabs: {
            main: tabs,
            hover: tabsHover
        },
        spot: { main: spot },
        hotel: { main: hotel },
        air: { main: air },
        package: { main: packageColor },
        car: { main: car },
        white: {
            main: white,
            alpha: white30
