        fontFamily: regular,
        fontSize: 16,
        h1: {
            fontFamily: bold,
            fontSize: "48px",
            lineHeight: "60px"
        },
        h2: {
            fontFamily: bold,
            fontSize: "36px",
            lineHeight: "40px"
        },
        h3: {
            fontFamily: bold,
            fontSize: "26px",
            lineHeight: "30px"
        },
        h4: {
            fontFamily: bold,
            fontSize: "22px",
            lineHeight: "28px"
        },
        h5: {
            fontFamily: bold,
            fontSize: "20px",
            lineHeight: "26px"
        },
        h6: {
            fontFamily: bold,
            fontSize: "18px",
            lineHeight: "24px"
        },
        subtitle: { fontSize: "14px", lineHeight: "18px" },
        caption: {
            color: primary,
            fontFamily: regular,
            fontSize: "12px",
            lineHeight: "16px"
        },
        body1: { fontSize: "16px" },
        body2: { fontSize: "14px" },
        body3: { fontSize: "12px" }
    },
    font: {
        regular,
        semibold: bold,
        bold
    },
    shadows: [
        "0px 0px 0px 0px rgba(0,0,0,0.16)",
        "0px 0px 1px 0px rgba(0,0,0,0.16)",
        "0px 0px 2px 0px rgba(0,0,0,0.16)",
        "0px 0px 3px 0px rgba(0,0,0,0.16)",
